function List(){

    const rarity ="Consumer Grade";
    const hexCode = "#4b69ff";

    return(
    <div className='container ' style={{backgroundColor: 'red'}}>
        <input type="checkbox" className='gradient'></input>
        <div>{rarity}</div>
    </div>);
}

export default List;
